import { signOut,getAuth } from "firebase/auth";
import { initializeApp } from "firebase/app";
import { useNavigate } from "react-router-dom";
function Main(){
    
    const navigate=useNavigate()


    

    const firebaseConfig = {
        apiKey: "AIzaSyBWwmyT8TSdEC1f_IhKHr-mZyAcHe_8NUE",
        authDomain: "auth-4a457.firebaseapp.com",
        projectId: "auth-4a457",
        storageBucket: "auth-4a457.appspot.com",
        messagingSenderId: "204038905074",
        appId: "1:204038905074:web:ad29cf18c376cee87bc46b",
        measurementId: "G-N4ZLY674TT"
    };


    const app = initializeApp(firebaseConfig);
    const auth = getAuth() // email / password auth
    
    const submitData=(event)=>{
        event.preventDefault()

       
        signOut(auth)  //authentication , email ,password

        .then(()=>{
            alert("logged out Successfully")
            navigate("/login")
           
        })
        .catch((err)=>{
            alert("Error", err)
        })


    }
    return(
        <div>
            <h1>Welocme to Dashboard...!</h1>
            <form onSubmit={submitData}>
                <button type="submit">Logout</button>
            </form>
        </div>
    )
}
export default Main;
